INSERT INTO `cereri` (`CerereId`, `NumeServer`, `Numele`, `EmailIntrodus`, `FactiuneaIntrodusa`, `CerereaLui`) VALUES
(1, 'BiG', 'Cristi', 'valea.cucu@gmail.com', 'C.I.A', ' Imi doresc foarte mult sa fiu lider. Stiu ca ma voi descurca ca sunt istet si capabil. sper sa fiu acceptat.'),
(2, 'SalamCutitar', 'Vlad Dop', 'dop.vlad@yahoo.com', 'Parlament', 'Nume: SalamCutitar\nStats:http://imgur.com/MXoTj0u\nFactiuni anterioare:-( nu am avut )\nMotiv:Vreau sa intru in aceasta factiune deoarece vreau sa incerc ceva nou\nDescriere : Am 16 ani, sunt din bucuresti, joc samp de 4 ani, am experienta pe servere mari, nu dau nume sa nu fac reclama.\nSper sa iau leader, multumesc.'),
(3, 'Mr.Zeth', '', 'Asd213!@', 'C.I.A.', 'Doresc  sa fiu in C.I.A depoarece pot face respect intre departamente am experienta de lider pot face o factiune foarte respectata din ea si respect intre departamente pot promite ca va fii cea mai buna factiune de pe BristonGOV. Multumesc!'),
(4, 'ANUBIS', 'Andrei Leca', 'Andy_Anu@yahoo.com', 'C.I.A ', 'As dorii sa fiu lider la C.I.A , din urmatoarele motive : \r\n\r\n- stiu TOT Wanted-listul si comenzile ; \r\n\r\n- am fost lider LVPD in alt server inainte sa intru pe Briston ; \r\n\r\n- consider ca F.B.I si C.I.A sunt una si aceeasi ; \r\n\r\n- stiu ca C.I.A si F.B.I se ocupa cu : siguranta nationala si spionaj ; Ea se ocupa de colectarea informatiilor (in special prin spionaj) si depistarea operatiunilor clandestine efectuate in exteriorul USA. Se spune ca ea are statut independent de conducerea tarii. Ea are in pricipal si en gros 2 roluri: de a furniza si analiza informatii cu privire la conduceri , intreprinderi si indivizi din orice tara a lumii pentru serviciul guvernului american, si de a dirija operatiunile clandestine (care constituie 3% din cheltuielile agentiei) dincolo de hotarele SUA .\r\n\r\n> Sper sa fiu ales lider in C.I.A :D :) :* VA MULTUMESC ! N-AM SA DEZAMAGESC PE NIMENI ! '),
(5, 'Pingu[].', 'Andrei Cristian', 'sykrim1702@yahoo.com', 'National Guard [NG]', 'Salut, sunt un baiat de 13 ani, din orasul Oradea, cu simtul umorului, sincer, sunt acel gen... cand ai nevoie sunt langa tine, si la bine si la greu, iar daca e, ma veti cunoaste pe parcurs.'),
(6, 'Kingstone', 'Rotaru Cosmin', 'dodo197880@yahoo.com', 'Ballas Gang.', 'Nume Real: Rotaru Cosmin.\r\nNume in joc: Kingstone.\r\nNume forum: Kingston.\r\nVarsta: 16 ani.\r\nLevel: 2.\r\nStiti regulamentul?: Desigur.\r\nFactiunea precedenta: Nu am.\r\nCererea ta: O sa-mi fac o caracterizare. Ma numesc Cosmin, m-am nascut si am crescut in Bucuresti si am 16 ani. Sunt o persoana de treaba, cu simtul umorului si cu cei 7 ani de acasa. Imi place sa imi fac prieteni noi, sa descopar multe lucruri noi si sa am parte de ele. Nu imi place sa ma cert, sa ma laud sau sa ma cert. Imi place sa stau acolo unde imi este locul. Sunt o persoana descurcareata, imi place sa fac unele lucruri pe cont propriu. Incerc sa fac acel lucru cat pot eu de bine, si nu il las niciodata neterminat. Imi ajut prietenii la nevoie, oricand au nevoie de mine, sau eu de ei. Nu astept ceva in schimb de la ei pe moment. Vreau doar sa imi ramana prieteni. Imi place foarte mult si munca in echipa, dar doar atunci cand e nevoie de ea.'),
(7, 'King', 'alex', 'ionita_allex@yahoo.com', 'Hitman', 'As dori lider la hitman agenti.:3 Am 18 ani experienta numai in hitman vreo 6-7 ani :-? '),
(8, 'RedBuLL', 'Alex', 'culcescu_alex@yahoo.com', 'Navy-Seal', 'Salut eu sunt RedBuLL.As dori sa ma inrolez in Navy-Seal ca General pentru apararea nedreptatilor si lucru in echipa asupra nedreptatilor.Multumesc'),
(9, 'Dylan', 'Alyn', 'stefu_a@yahoo.com', 'LSPD', '                   !L.S.PD!\r\n\r\nAs dori lider la lspd pentru a face lege in orasul L.S,L.V,S.F,!\r\nVoi da salari pe masura la angajati chiar si prime!\r\nAm lv 14 50 ore jucate!\r\nSi cred ca sunt un lider unic!\r\nAcum tu decizi\r\n\r\n\r\n!Cu stima Dylan!\r\n\r\n\r\n\r\n\r\n\r\n                                                     Semnatura:!..::!@BLonDu@!::..!');
